// src/pages/Tutor/TutorDetails.jsx
import React, { useEffect, useState } from 'react';
import { useParams, useNavigate, Link } from 'react-router-dom';
import api from '../../services/api';

export default function TutorDetails() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [tutor, setTutor] = useState(null);
  const [form, setForm] = useState({
    nome: '',
    email: '',
    cpf: '',
    endereco: '',
    dataNascimento: ''
  });
  const [editando, setEditando] = useState(false);

  useEffect(() => {
    api.get(`/tutores/${id}`).then((res) => {
      setTutor(res.data);
      setForm({
        nome: res.data.nome,
        email: res.data.email,
        cpf: res.data.cpf,
        endereco: res.data.endereco,
        dataNascimento: res.data.dataNascimento?.slice(0, 10)
      });
    });
  }, [id]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm((prev) => ({ ...prev, [name]: value }));
  };

  const handleUpdate = async (e) => {
    e.preventDefault();
    await api.put(`/tutores/${id}`, form);
    setEditando(false);
    navigate('/tutores');
  };

  const handleDelete = async () => {
    if (window.confirm('Tem certeza que deseja excluir este tutor?')) {
      await api.delete(`/tutores/${id}`);
      navigate('/tutores');
    }
  };

  if (!tutor) return <p>Carregando...</p>;

  return (
    <div className="container my-4">
      <div className="d-flex justify-content-between align-items-center mb-3">
        <button onClick={() => navigate('/tutores')} className="btn btn-secondary">← Voltar</button>
      </div>

      <h3>Detalhes do Tutor</h3>

      {editando ? (
        <form onSubmit={handleUpdate}>
          <div className="mb-3">
            <label className="form-label">Nome</label>
            <input name="nome" className="form-control" value={form.nome} onChange={handleChange} />
          </div>
          <div className="mb-3">
            <label className="form-label">Email</label>
            <input name="email" className="form-control" value={form.email} onChange={handleChange} />
          </div>
          <div className="mb-3">
            <label className="form-label">CPF</label>
            <input name="cpf" className="form-control" value={form.cpf} onChange={handleChange} />
          </div>
          <div className="mb-3">
            <label className="form-label">Endereço</label>
            <input name="endereco" className="form-control" value={form.endereco} onChange={handleChange} />
          </div>
          <div className="mb-3">
            <label className="form-label">Data de Nascimento</label>
            <input type="date" name="dataNascimento" className="form-control" value={form.dataNascimento} onChange={handleChange} />
          </div>

          <button type="submit" className="btn btn-success me-2">Salvar</button>
          <button type="button" className="btn btn-secondary" onClick={() => setEditando(false)}>Cancelar</button>
        </form>
      ) : (
        <>
          <ul className="list-group mb-3">
            <li className="list-group-item"><strong>Nome:</strong> {tutor.nome}</li>
            <li className="list-group-item"><strong>Email:</strong> {tutor.email}</li>
            <li className="list-group-item"><strong>CPF:</strong> {tutor.cpf}</li>
            <li className="list-group-item"><strong>Endereço:</strong> {tutor.endereco}</li>
            <li className="list-group-item"><strong>Data de Nascimento:</strong> {new Date(tutor.dataNascimento).toLocaleDateString('pt-BR')}</li>
            <li className="list-group-item"><strong>Data de Cadastro:</strong> {new Date(tutor.dataCadastro).toLocaleDateString('pt-BR')}</li>
          </ul>

          <div className="mb-4">
            <button className="btn btn-warning me-2" onClick={() => setEditando(true)}>Editar</button>
            <button className="btn btn-danger" onClick={handleDelete}>Excluir</button>
          </div>
        </>
      )}
    </div>
  );
}
